import './App.css';
import React, { useState } from 'react';



function App() {
    const [notesOne, setNotesOne] = useState(false);
    const [notesTwo, setNotesTwo] = useState(false);
    const [notesTree, setNotesThree] = useState(false);
    return <div>
        <div style = {{display: "flex"}}>
        <p style = {{margin: "10px"}}>{notesOne? "пизда": "звезда"}</p>
        <p style = {{margin: "10px"}}>{notesTwo? "редис": "писпис"}</p>
        <p style = {{margin: "12px"}}>{notesTree? "миш": "кис"}</p>
        </div>

        <button onClick = {() => setNotesOne(!notesOne)}>кнопка1</button>
        <button onClick = {() => setNotesTwo(!notesTwo)}>кнопка2</button>
        <button onClick = {() => setNotesThree(!notesTree)}>кнопка3</button>
    </div>

}

export default App;
